import styled from 'styled-components';

const Main = styled.div`
  background-color: ${(props) => props.theme.primaryLight};
  grid-area: main;
  border-bottom-right-radius: 8px;
  overflow-y: auto;
  padding: 4rem 4rem;
  font-weight: 300;
  position: relative;
`;

export default Main;
